function LapRunners() {
  const { runners, setRunners, resetRunners } = this.props;
  return (
    <div style={{ textAlign: "center" }}>
      <div>
        <span>Tracking </span>
        <span>
          {" "}
          <input type="number" />{" "}
        </span>
        <span> Runners</span>
      </div>

      {/* Buttons */}
      <div>
        {this.props.runners == null ? `null` : `not null`}
        <div>Start</div>
        <div>Reset</div>
      </div>
    </div>
  );
}

export default LapRunners;
